namespace RonSijm.FluidHumidifier.Factories.CodePipeline;

public class CustomActionTypeFactory(string resourceName = null, Action<Humidifier.CodePipeline.CustomActionType> factoryAction = null) : ResourceFactory<Humidifier.CodePipeline.CustomActionType>(resourceName)
{

    internal List<InnerCustomActionTypeConfigurationPropertiesFactory> ConfigurationPropertiesFactories { get; set; } = [];

    internal InnerCustomActionTypeArtifactDetailsFactory InputArtifactDetailsFactory { get; set; }

    internal InnerCustomActionTypeArtifactDetailsFactory OutputArtifactDetailsFactory { get; set; }

    internal InnerCustomActionTypeSettingsFactory SettingsFactory { get; set; }

    protected override Humidifier.CodePipeline.CustomActionType Create()
    {
        var customActionTypeResult = CreateCustomActionType();
        factoryAction?.Invoke(customActionTypeResult);

        return customActionTypeResult;
    }

    private Humidifier.CodePipeline.CustomActionType CreateCustomActionType()
    {
        var customActionTypeResult = new Humidifier.CodePipeline.CustomActionType
        {
            GivenName = InputResourceName,
        };

        return customActionTypeResult;
    }
    public override void CreateChildren(Humidifier.CodePipeline.CustomActionType result)
    {
        base.CreateChildren(result);

        result.ConfigurationProperties = ConfigurationPropertiesFactories.Any() ? ConfigurationPropertiesFactories.Select(x => x.Build()).ToList() : null;
        result.InputArtifactDetails ??= InputArtifactDetailsFactory?.Build();
        result.OutputArtifactDetails ??= OutputArtifactDetailsFactory?.Build();
        result.Settings ??= SettingsFactory?.Build();
    }

} // End Of Class

